(1, NULL, 'First blog post', 'first-blog-post', 'The first ever blog post is here. It might be a good idea to update this post with some more relevant content.', 'This is your first ever **blog post**! It might be a good idea to update this post with some more relevant content.\n\nYou can edit this content by selecting **Blog** from the administration back-end menu.\n\n*Enjoy the good times!*', '<p>This is your first ever <strong>blog post</strong>! It might be a good idea to update this post with some more relevant content.</p>\n<p>You can edit this content by selecting <strong>Blog</strong> from the administration back-end menu.</p>\n<p><em>Enjoy the good times!</em></p>', '2018-09-05 04:52:23', 1, '2018-09-05 04:52:23', '2018-09-05 04:52:23'),
(2, 1, 'halaqa', 'halaqa', 'L\'école coranique pour adultes de la mosquée Al-Andalous a vu le jour en 2013. \r\nElle compte aujourd\'hui plus de 40 étudiants des différents niveaux dont certains ont déjà mémorisé le coran en entier.', 'L\'école coranique pour adultes de la mosquée Al-Andalous a vu le jour en 2013. \r\nElle compte aujourd\'hui plus de 40 étudiants des différents niveaux dont certains ont déjà mémorisé le coran en entier. \r\n\r\nIl y a présentement cinq groupes: \r\n* Deux groupes pour la mémorisation Sourat Al-Bakara\r\n* Deux groupes pour la mémorisation de Sourat Ali-Imran \r\n* Un groupe des étudiants avancés qui sont répartis selon la capacité de la mémorisation hebdomadaire de chacun. \r\n\r\nPour les quatres premiers groupes, un minimum de mémorisation d\'une page se fait au cours de la séance avec l\'enseignant. \r\nPour le groupe avancé, chaque étudiant est testé sur le nombre des pages mémorisées individuellement dans la semaine.\r\n\r\nL\'école a également instauré récemment un programme de parrainage: Les étudiants de niveau avancé aide les étudiants qui ressentent un besoin supplémentaire d\'accompagnement dans la récitation et la maîtrise des règles de Tajwid. \r\nL\'école organise également de temps en temps des cours sur les règles de Tajwid pour tous les niveaux [lien aux annonces en question].', '<p>L\'école coranique pour adultes de la mosquée Al-Andalous a vu le jour en 2013.\nElle compte aujourd\'hui plus de 40 étudiants des différents niveaux dont certains ont déjà mémorisé le coran en entier. </p>\n<p>Il y a présentement cinq groupes: </p>\n<ul>\n<li>Deux groupes pour la mémorisation Sourat Al-Bakara</li>\n<li>Deux groupes pour la mémorisation de Sourat Ali-Imran </li>\n<li>Un groupe des étudiants avancés qui sont répartis selon la capacité de la mémorisation hebdomadaire de chacun. </li>\n</ul>\n<p>Pour les quatres premiers groupes, un minimum de mémorisation d\'une page se fait au cours de la séance avec l\'enseignant.\nPour le groupe avancé, chaque étudiant est testé sur le nombre des pages mémorisées individuellement dans la semaine.</p>\n<p>L\'école a également instauré récemment un programme de parrainage: Les étudiants de niveau avancé aide les étudiants qui ressentent un besoin supplémentaire d\'accompagnement dans la récitation et la maîtrise des règles de Tajwid.\nL\'école organise également de temps en temps des cours sur les règles de Tajwid pour tous les niveaux [lien aux annonces en question].</p>', '2018-09-04 06:50:58', 1, '2018-09-05 06:49:50', '2018-09-06 07:22:34'),
